import React from "react"

export default props => {

    function most() {
        for(let i = 0; i < props.numeros.length; i++) {
            // eslint-disable-next-line no-unused-expressions
            <div>{props.numeros[i]}</div>
        }
    }

    return (
        <div>
            Os números gerados são: {most}
        </div>
    )
}
